import React from "react";

export function UserProfile(){
    const [user, setUserData] = useState([]);
    return (
        <div>
            <h1 style={{color:"orange",border:"2px solid gray",borderRadius:"5px"}}><em>User Profile</em></h1>
            <ul style={{margin:"0",padding:"0"}}>
                {user.map((userDetail) => {
                return (
                    <li key={userDetail._id} style={{listStyleType:"none"}}>
                    <div style={{padding:"15px 0",fontSize:"larger",color:"gray"}}>Name : {userDetail.name}</div>
                    <div style={{padding:"15px 0",fontSize:"larger",color:"gray"}}>User-ID : {userDetail._id}</div>
                    <div style={{padding:"15px 0",fontSize:"larger",color:"gray"}}>Email-ID: {userDetail.mail}</div>
                    <div style={{padding:"15px 0",fontSize:"larger",color:"gray"}}>Contact-No : {userDetail.phone}</div>
                    </li>
                )
                })}
            </ul>
        </div>
    )
}
